import s from './index.module.css'

export default function Product( {firstName, lastname, age}) {
  return (
    <div className={s.users_card}>
        <p>Firstname: { firstname } </p>
        <p>Lastname: { lastname } </p>
        <p>Age: { age } </p>

    </div>
  )
}
